const SlideDrawer = ({ drawer,toggleDrawer }) => {
  return (
    <Drawer anchor="right" open={drawer}>
      <List sx={{ width: 400 }}>
        <ListItem button onClick={() => alert("F1")}>
          F1111111111
        </ListItem>
        <ListItem button onClick={() => alert("F2")}>
          F222222222222
        </ListItem>
      </List>
    </Drawer>
  );
};

export default SlideDrawer;
